import '../node_modules/bootstrap/dist/js/bootstrap.bundle.min.js';
import Navbar from './components/Navbar/navbar';
import * as TagName from "../constants/constants";

function App() {
  return (
    <React.Fragment>
    <div className="App">
      <Navbar/>

      <nav aria-label="Page navigation example">
        <ul className="pagination">
          <li className="page-item"><a class="page-link" href="#">1</a></li>
          </ul>

          { 
            }

      </nav>



    </div>
    </React.Fragment>
  );

  getPaginationBar = (data => {
    const dataLength = Number.parseInt(data.length) / 7;
    const result = () => {
      for (let i = 1; i >= dataLength; i++) {
        <li className="page-item"><a className="page-{i}" href="#">{i}</a></li>
      }
    }
    return result;
  });

}

export default App;
